import React, { useEffect, useState } from 'react';
import axios from '../../api/axios';
import {
  Paper, Typography, Table, TableBody, TableCell, TableContainer,
  TableHead, TableRow, CircularProgress, Alert, Button, Dialog,
  DialogTitle, DialogContent, DialogActions
} from '@mui/material';

export default function MarketWatchFull() {
  const [stocks, setStocks] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [selectedStock, setSelectedStock] = useState(null);

  useEffect(() => {
    const fetchStocks = async () => {
      try {
        const res = await axios.get('/stock', {
          headers: {
            Authorization: `Bearer ${localStorage.getItem('token')}`,
          },
        });
        setStocks(res.data);
      } catch (err) {
        setError('Failed to load stocks'  + err);
      } finally {
        setLoading(false);
      }
    };
    fetchStocks();
  }, []);

  return (
    <Paper sx={{ padding: 3, margin: 4 }}>
      <Typography variant="h5" gutterBottom>Market Watch (All Stocks)</Typography>

      {loading && <CircularProgress />}
      {error && <Alert severity="error">{error}</Alert>}

      {!loading && !error && (
        <TableContainer>
          <Table>
            <TableHead>
              <TableRow>
                <TableCell>Code</TableCell>
                <TableCell>Company Name</TableCell>
                <TableCell>Open</TableCell>
                <TableCell>High</TableCell>
                <TableCell>Low</TableCell>
                <TableCell>Close</TableCell>
                <TableCell>Action</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {stocks.map((stock) => (
                <TableRow key={stock.id}>
                  <TableCell>{stock.Code}</TableCell>
                  <TableCell>{stock['Company Name']}</TableCell>
                  <TableCell>{stock['Open Price']}</TableCell>
                  <TableCell>{stock['High Price']}</TableCell>
                  <TableCell>{stock['Low Price']}</TableCell>
                  <TableCell>{stock['Close Price']}</TableCell>
                  <TableCell>
                    <Button variant="outlined" size="small" onClick={() => setSelectedStock(stock)}>
                      View
                    </Button>
                  </TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </TableContainer>
      )}

      <Dialog open={!!selectedStock} onClose={() => setSelectedStock(null)} maxWidth="sm" fullWidth>
        <DialogTitle>Stock Details</DialogTitle>
        <DialogContent dividers>
          {selectedStock && (
            <>
              <Typography><strong>Code:</strong> {selectedStock.Code}</Typography>
              <Typography><strong>Company Name:</strong> {selectedStock['Company Name']}</Typography>
              <Typography><strong>Date:</strong> {selectedStock.Date}</Typography>
              <Typography><strong>Open:</strong> {selectedStock['Open Price']}</Typography>
              <Typography><strong>High:</strong> {selectedStock['High Price']}</Typography>
              <Typography><strong>Low:</strong> {selectedStock['Low Price']}</Typography>
              <Typography><strong>Close:</strong> {selectedStock['Close Price']}</Typography>
              <Typography><strong>Volume:</strong> {selectedStock.Volume}</Typography>
            </>
          )}
        </DialogContent>
        <DialogActions>
          <Button onClick={() => setSelectedStock(null)}>Close</Button>
        </DialogActions>
      </Dialog>
    </Paper>
  );
}
